import React from 'react'

function Table(props) {
    const { tableData, headerData } = props;const tableHeader = () => {
        return headerData.map((data, idx) => {
          return (        
              <td key={idx}>{data}</td>
          )
        })
      }
    
      const returnTableData = () => {
        return tableData.map((todos, idx) => {
          const { id, title, completed } = todos;
          return (
            <tr data-id={id} key={id}>
              <td>{id}</td>
              <td>{title}</td>
              <td>{completed === false ? 'false' : 'true'}</td>
            </tr>
          )
        });
      }
    
      return (
        <>
          <table>
            <thead>
              <tr>            
                {tableHeader()}
              </tr>          
            </thead>
            <tbody>
              {returnTableData()}          
            </tbody>
          </table>
        </>
      )
}

export default Table
